import React from 'react';

const MainMenu = () => {
  return (
    <nav>
      <ul style={{display: 'flex', justifyContent: 'space'}}>
        <li>
          <a href={'https://twitter.com/'} >Home</a>
        </li>
        <li>
          <a>Battle Royale</a>
        </li>
        <li>
          <a>Creative</a>
        </li>
        <li>
          <a>Save the World</a>
        </li>
      </ul>
    </nav>
  );
}

export default MainMenu;
